function uploadFile(file,idSetting){console.log(idSetting);$.ajax({url:"/informations/"+idSetting+"/upload-file",type:"POST",data:file,processData:false,contentType:false,cache:false,dataType:"json",success:function(responseTemplate){},error:function(){}})}$(document).ready(()=>{console.log(idSetting);let inputFile=$("input#uploadFile");inputFile.click(e=>{e.target.value=null});inputFile.change(e=>{let file=e.target.files[0];let formData=new FormData;formData.append("uploadFile",file);uploadFile(formData,idSetting)})});